import logo from './logo.svg';
import './App.css';
import CurrentTime from './currentTime';
import Timer from './timer';
import Text from './text';

function App() {
  return (
    <div className="App">
        <CurrentTime/>  <br/>
        <Timer/>        <br/>
        <Text/>         <br/>
    </div>
  );
}

export default App;
